    doc.loc.source = {"body":"extend type Query {\n  # Get all users ordered by: OrderByUserInput add filtered by: FilterUserInput\n  users(orderBy: OrderByUserInput, filter: FilterUserInput): [User]\n  # Get user by id\n  user(id: Int!): UserPayload\n  # Get current user\n  currentUser: User\n}\n\n# Description of individual User\ntype User {\n  id: Int!\n  role: String\n  first_name: String\n  last_name: String\n  email: String\n  username: String\n  telephone: String\n  is_active: Boolean\n  auth: UserAuth\n}\n\n# Payload returned on mutation of User type\ntype UserPayload {\n  user: User\n  errors: [FieldError!]\n}\n\n### TO DELETE START\n# Additional authentication service info\ntype UserAuth {\n  certificate: CertificateAuth\n  facebook: FacebookAuth\n  google: GoogleAuth\n  github: GithubAuth\n  linkedin: LinkedInAuth\n}\n\ntype CertificateAuth {\n  serial: String\n}\n\ntype FacebookAuth {\n  fbId: String\n  displayName: String\n}\n\ntype GoogleAuth {\n  googleId: String\n  displayName: String\n}\n\ntype GithubAuth {\n  ghId: String\n  displayName: String\n}\n\ntype LinkedInAuth {\n  lnId: String\n  displayName: String\n}\n### TO DELETE END\n\nextend type Mutation {\n  # Create user with role of admin\n  addAdmin(input: AddUserInput!): UserPayload!\n  # Edit a user\n  #editUser(input: EditUserInput!): UserPayload!\n  # Delete a user\n  deleteUser(id: Int!): UserPayload!\n}\n\n# Input for addUser Mutation\ninput AddUserInput {\n  email: String!\n  role: String\n  username: String\n  first_name: String\n  last_name: String\n  telephone: String\n  password: String\n  is_active: Boolean\n}\n\n# Input for ordering users (**MODIFY**)\ninput OrderByUserInput {\n  # id | username | role | is_active | email\n  column: String\n  # asc | desc\n  order: String\n}\n\n# Input for filtering users (**MODIFY**)\ninput FilterUserInput {\n  # search by username or email\n  searchText: String\n  # filter by role\n  role: String\n  # filter by is_active\n  is_active: Boolean\n}\n\nextend type Subscription {\n  # Subscription for users list\n  usersUpdated(filter: FilterUserInput): UpdateUserPayload\n}\n\n# Payload for usersUpdated Subscription\ntype UpdateUserPayload {\n  mutation: String!\n  node: User!\n}\n","name":"GraphQL request","locationOffset":{"line":1,"column":1}};
  

